import React from 'react';

const HomePage = () => {
  return (
    <div className="container" style={{ padding: '40px 15px', minHeight: '60vh', textAlign: 'center' }}>
        <h1>Welcome to NPS Kudlu Banglauru</h1>
        <p style={{ fontSize: '1.2rem' }}>We Educate For Life!</p>
        <p>This is the home page. You can build out this section with more components.</p>
    </div>
  );
};

export default HomePage;
